import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Link from '@material-ui/core/Link';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import { useHistory } from 'react-router-dom';
import {getToken, removeUserSession} from '../../Utils/Common';
import logo2 from '../../public/photos/logo2.png';

const useStyles = makeStyles(theme => ({


    linksBar: {
        flexGrow: 1,
    },
    link: {
        marginLeft: theme.spacing(2),
        color: "white"
    },
    appBar: {
        background: "navy",
        color: "White"
    }
}));

export default function Navbar() {

    const classes = useStyles();
    const token = getToken();
    const username = sessionStorage.getItem('user_username')
    let history = useHistory();

    const [anchorEl1, setAnchorEl1] = useState(null);
    const [anchorEl2, setAnchorEl2] = useState(null);
    const [anchorEl3, setAnchorEl3] = useState(null);


    const handleClose = () => {
        setAnchorEl1(null);
        setAnchorEl2(null);
        setAnchorEl3(null);
    };

    if (!token) {
        return (
            <AppBar className={classes.appBar} position="static">
                <Toolbar>
                <Typography variant="h6" className={classes.linksBar}>
                        <img src = {logo2} height="42" width="42"/>
                        <Button className={classes.link} href="/">Home</Button>
                        <Button className={classes.link} href="/news">News</Button>
                        <Button className={classes.link} href="/resorts">Resorts</Button>
                        <Button className={classes.link} href="/about_us">About us</Button>
                        <Button color="inherit" aria-controls="simple-menu" aria-haspopup="true" onClick={(e) => setAnchorEl1(e.currentTarget)}>
                        Cabins</Button>
                    <Menu
                        id="asd"
                        anchorEl={anchorEl1}
                        keepMounted
                        open={Boolean(anchorEl1)}
                        onClose={handleClose}
                    >
                        <MenuItem onClick={() => {handleClose(); history.push('/search_cabins')}}>Search cabins</MenuItem>
                        <MenuItem onClick={() => {handleClose(); history.push('/add_cabin')}}>List a cabin</MenuItem>
                    </Menu>
                    </Typography>
                    <Button href="/login" color="inherit">Login</Button>
                    <Button href="/register" color="inherit">Register</Button>
                </Toolbar>
            </AppBar>
        )
    }
    else if (token) {
        return (
            <AppBar className={classes.appBar} position="static">
                <Toolbar>
                    <Typography variant="h6" className={classes.linksBar}>
                        <img src = {logo2} height="42" width="42"/>
                        <Button className={classes.link} href="/">Home</Button>
                        <Button className={classes.link} href="/news">News</Button>
                        <Button className={classes.link} href="/resorts">Resorts</Button>
                       
                        <Button className={classes.link} href="/about_us">About us</Button>
                        <Button color="inherit" aria-controls="simple-menu" aria-haspopup="true" onClick={(e) => setAnchorEl1(e.currentTarget)}>
                        Cabins</Button>
                    <Menu
                        id="asd"
                        anchorEl={anchorEl1}
                        keepMounted
                        open={Boolean(anchorEl1)}
                        onClose={handleClose}
                    >
                        <MenuItem onClick={() => {handleClose(); history.push('/search_cabins')}}>Search cabins</MenuItem>
                        <MenuItem onClick={() => {handleClose(); history.push('/add_cabin')}}>List a cabin</MenuItem>
                    </Menu>
                    </Typography>

                    <Button>{sessionStorage.getItem("user_role") === 1 ? "Admin tools": null}</Button>
                   

                    <Button color="inherit" aria-controls="simple-menu" aria-haspopup="true" onClick={(e) => setAnchorEl2(e.currentTarget)}>
                        {username}</Button>
                    <Menu
                        id="simple-menu"
                        anchorEl={anchorEl2}
                        keepMounted
                        open={Boolean(anchorEl2)}
                        onClose={handleClose}
                    >
                        <MenuItem onClick={() => {handleClose(); history.push('/account_info')}}>My Account</MenuItem>
                        <MenuItem onClick={() => {handleClose(); history.push('/my_cabins')}}>My Cabins</MenuItem>
                        <MenuItem onClick={() => { removeUserSession(); window.location.reload() }} >Logout</MenuItem>
                    </Menu>
                   
                </Toolbar>
            </AppBar>
        )
    }
}
